  DELETE /users/123           // Delete user with ID 123
  `,explanation:"Examples of common RESTful API endpoints and their associated HTTP methods."}]},{term:"Database",definition:"An organized collection of data, generally stored and accessed electronically from a computer system.",examples:[{language:"SQL (Concept)",code:`// Common Database Types:
