  `,explanation:"Describes how an integration test would cover the flow of data across different parts of a system, like a user logging in."}]},{term:"Dependency Injection",definition:"An architectural pattern where components receive their dependencies from an external source rather than creating them internally. This improves modularity and testability.",examples:[{language:"JavaScript (Concept)",code:`// Without Dependency Injection
